import React from "react";
import "./NewItems.css";
import Thumbnail from "./Thumbnail";

function NewItems() {
  return (
    <>
      <div class="container">
        <h1>NEW ITEMS</h1>
        <div class="thumbnail-container">
          <div>
            <Thumbnail />
            <p class="title">Sigil Stickers</p>
            <p>Sigil stickers for protection and releasing negativity</p>
          </div>
          <div>
            <Thumbnail />
            <p class="title">Enchanted Meadow Printable Oracle Deck</p>
            <p>Printable DIY oracle deck</p>
          </div>
          <div>
            <Thumbnail />
            <p class="title">Dear Diary Printable Oracle Deck</p>
            <p>This oracle deck provides insight it</p>
          </div>
        </div>
      </div>
    </>
  );
}

export default NewItems;
